import React, { useState } from "react";
import "../css/Contact.css";

const ContactPage = () => {
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({
    customerName: "",
    date: "",
    machine: "",
    beltType: "",
    temperature: "",
    beltLength:"",
    beltWidth:"",
    beltColor:"",
    cleatPitch:"",
    cleatHeight:"",
    cleatWidth:"",
    SprocketOD:"",
    SprocketBore:"",
    ConveryorLength:"",
    Angleofinclination:"",
    Product:"",
    TemperatureofProduct:"",
    roomTemperature:"",
    ProductSize:"",
    Weight:"",
    TotalLoad:"",
    SpeedConveyor:"",
    WorkingHours:"",
    // Add other fields as needed
  });

  const nextStep = () => {
    setStep(step + 1);
  };

  const prevStep = () => {
    setStep(step - 1);
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:3001/submitform', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        console.log('Form submitted successfully!');
      } else {
        console.error('Form submission failed.');
      }
    } catch (error) {
      console.error('Error submitting form:', error);
    }
  };


  return (
    <div className="container">
      <div className="card">
        <form className="form" onSubmit={handleSubmit}>
          {step === 1 && (
            <div>
              <h2>Step 1: Customer Details</h2>
              <label>
                Customer Name:
                <input
                  type="text"
                  name="customerName"
                  value={formData.customerName}
                  onChange={handleChange}
                />
              </label>
              <br />
              <label>
                Date:
                <input
                  type="date"
                  name="date"
                  value={formData.date}
                  onChange={handleChange}
                />
              </label>
              <br />
              <button className='next'type="button" onClick={nextStep}>
                Next
              </button>
            </div>
          )}

          {step === 2 && (
            <div>
              <h2>Step 2: Technical Details</h2>
              <label>
               Machine:
               <input
               type="text"
               name="machine"
               value={formData.machine}
               onChange={handleChange}
             />
             </label>
             <br />

             <label>
           Belt Type / Pitch:
             <input
             type="text"
             name="beltType"
             value={formData.beltType}
             onChange={handleChange}
